int num_with_prefix(string s) {
	//cout << s << '\n';
	if (precomp.count(s)) {
		return precomp[s];
	}
	
	added = 0;

	// setup grid
	grid = vector<string>(6);
	grid[0] = "AAAAA";
	for (int i = 1; i <= s.length() / 5; i++) {
		grid[i] = s.substr((i - 1) * 5, 5);
	}
	if (s.length() % 5) {
		grid[s.length() / 5 + 1] = s.substr(s.length() / 5 * 5, s.length() % 5);
	}

	// setup the letters that must be placed
	vector<bool> placed(25);
	for (auto c : s) {
		placed[c - 'A'] = 1;
	}

	/* check if it is possible to place all letters to the left of the larger already 
	placed letters and if to the left of what column they must be placed in*/
	vector<int> first(25,4);
	to_place.clear();
	int space_left = 0;
	for (int j = 0; j < 5; j++) {
		if (j) {
			space_left += (5 - (s.length() / 5 + (j - 1 < s.length() % 5)));
		}
		for (int i = 1; i <= s.length() / 5 + (j < s.length() % 5); i++) {
			int placed_to_left = 0;
			for (int k = 0; k < grid[i][j] - 'A'; k++) {
				if (!placed[k]) {
					first[k] = min(first[k], j - 1);
					placed_to_left++;
				}
			}
			if (placed_to_left > space_left) {
				return 0;
			}
		}
	}

	for (int i = 0; i < 25; i++) {
		if (!placed[i]) {
			to_place.push_back({ char('A' + i), first[i] });
		}
	}

	reverse(to_place.begin(), to_place.end());
	find_total();
	return added;
}

